INSERT INTO `movies` (`id`, `title`, `director`, `release_year`, `genre_1`, `description`, `created_at`, `updated_at`, `movie_cover`, `genre_2`, `genre_3`) VALUES
(1, 'The Wild Robot', 'Chris Sanders', 2024, 'Animáció', 'Miután hajótörést szenved, egy intelligens robot, Roz egy lakatlan szigeten reked. A kemikált környezetben túlélés érdekében Roz kapcsolatba lép a sziget állataival, és gondoskodik egy árva kis libáról.', '2024-11-13 10:35:24', '2024-11-13 10:35:24', , 'Komédia', 'Sci-Fi');
INSERT INTO `movies` (`id`, `title`, `director`, `release_year`, `genre_1`, `description`, `created_at`, `updated_at`, `movie_cover`, `genre_2`, `genre_3`) VALUES
(2, 'Smile 2', 'Parker Finn', 2024, 'Horror', 'A világ körüli turnéra készülő globális popszenzáció, Skye Riley egyre félelmetesebb és megmagyarázhatatlan eseményeket tapasztal. A fokozódó borzalmak és a hírnév terhe alatt Skye kénytelen szembenézni a múltjával.', '2024-11-13 10:44:39', '2024-11-25 10:02:41', NULL, 'Rejtély', 'Thriller'),
(3, 'Venom: The Last Dance', 'Kelly Marcel', 2024, 'Akció', 'Eddie és Venom menekülnek. Mindkét világuk vadászik rájuk, és a hurok egyre szorosabbra feszül. A duónak végül egy olyan döntést kell hoznia, amely véget vet Venom és Eddie utolsó táncának.\r\n', '2024-11-13 10:59:22', '2024-11-13 10:59:22', NULL, 'Kaland', 'Sci-Fi'),
(4, 'Aquaman and the Lost Kingdom', 'James Wan', 2024, 'Akció', 'Aquaman és Mera új kihívásokkal szembesülnek, miközben egy elfeledett birodalom rejtett titkait fedezik fel, amelyek fenyegetik Atlantisz jövőjét.', '2024-11-13 11:12:45', '2024-11-13 11:12:45', NULL, 'Kaland', 'Fantasy'),
(5, 'Deadpool 3', 'Shawn Levy', 2024, 'Akció', 'Deadpool visszatér, és ezúttal a multiverzum legnagyobb hőseivel és legrosszabb gonoszaival találkozik. Képregényekből és filmekből ismert karakterek jelennek meg, hogy egy hatalmas, kaotikus kalandot alkossanak.', '2024-11-13 11:16:24', '2024-11-13 11:16:24', NULL, 'Képregény', 'Sci-Fi'),
(6, 'The Marvels', 'Nia DaCosta', 2023, 'Akció', 'Carol Danvers (Captain Marvel), Monica Rambeau és Kamala Khan (Ms. Marvel) összefognak, hogy legyőzzenek egy új veszélyt, amely a galaxis jövőjét fenyegeti.', '2024-11-13 11:24:26', '2024-11-13 11:24:26', NULL, 'Sci-Fi', 'Kaland'),
(7, 'Mission: Impossible – Dead Reckoning Part One', 'Christopher McQuarrie', 2023, 'Akció', 'Ethan Hunt és csapata ismét veszélybe kerül, amikor egy globális fenyegetés miatt új küldetést kapnak, amely során a világ legnagyobb titkai kerülnek napvilágra.', '2024-11-13 11:27:00', '2024-11-13 11:27:00', NULL, 'Thriller', 'Kém'),
(8, 'Godzilla x Kong: The New Empire', 'Adam Wingard', 2024, 'Akció', 'Godzilla és Kong ismét összeütköznek egy új, titokzatos fenyegetés miatt, amely képes mindkettejüket legyőzni. Képességeik és erejük határát feszegetve küzdenek a túlélésért.', '2024-11-13 11:30:39', '2024-11-13 11:30:39', NULL, 'Sci-Fi', 'Kaland'),
(9, 'The Hunger Games: The Ballad of Songbirds and Snakes', 'Francis Lawrence', 2023, 'Akció', 'A történet visszanyúlik a fiatal Coriolanus Snow (a jövőbeli diktátor) életéhez, amikor mentor szerepet vállal egy fiatal női tribútnál a 10. Évi Éhínségi Játékokban.', '2024-11-13 11:34:14', '2024-11-13 11:34:14', NULL, 'Dráma', 'Sci-Fi'),
(10, 'The Little Mermaid (Live-Action Remake)', 'Rob Marshall', 2023, 'Kaland', 'A híres Disney mese élőszereplős változata, amely Ariel, a tenger alatti királyság hercegnője történetét meséli el, aki szeretné felfedezni a felszínt és ott megtalálni a szerelmet.', '2024-11-19 09:18:01', '2024-11-19 09:18:01', NULL, 'Családi', 'Fantasy'),
(11, 'Spider-Man: Beyond the Spider-Verse', 'Joaquim Dos Santos, Kemp Powers, Justin K. Thompson', 2024, 'Animáció', 'Miles Morales újra visszatér a multiverzum útjain, ahol különböző verziókban találkozik más Spider-Manekkel. Az univerzum határain túlra kell utaznia, hogy megmentse a világot.', '2024-11-19 09:29:48', '2024-11-19 09:29:48', NULL, 'Akció', 'Képregény'),
(12, 'The Flash', 'Andrés Muschietti', 2023, 'Akció', 'Barry Allen (The Flash) új kalandokba keveredik, miközben próbálja megelőzni a közelgő katasztrófát, amely az idővonalat is veszélyezteti. A multiverzum hatásai továbbra is érezhetőek.', '2024-11-19 09:34:59', '2024-11-19 09:35:57', NULL, 'Sci-Fi', 'Képregény'),
(13, 'Wicked', 'Jon M. Chu', 2024, 'Musical', 'A híres Broadway musical filmes változata, amely Elphaba és Glinda barátságát meséli el, két különböző szélhámos boszorkány történetét, akik végül az Oz-i birodalom sorsát formálják.', '2024-11-19 09:53:20', '2024-11-19 09:53:20', NULL, 'Fantasy', NULL),
(14, 'Top Gun: Maverick', 'Joseph Kosinski', 2022, 'Akció', 'Pete \"Maverick\" Mitchell, aki már évtizedek óta a légi harcok mestere, visszatér, hogy oktassa a legújabb generációt. Miközben segít a fiatal pilótáknak, saját múltjával is szembesülni kénytelen.', '2024-11-19 10:05:01', '2024-11-19 10:05:01', NULL, 'Dráma', 'Kaland'),
(15, 'Everything Everywhere All at Once', 'Daniel Scheinert, Daniel Kwan', 2022, 'Sci-Fi', 'Evelyn Wang egy kínai-amerikai nő, aki egy hagyományos éttermet vezet. Azonban hirtelen belép a multiverzumba, ahol több verziója éli különböző életét, és neki kell megoldania egy mindent elpusztító problémát.', '2024-11-19 10:11:22', '2024-11-19 10:11:22', NULL, 'Akció', 'Dráma'),
(16, 'Spider-Man: No Way Home', 'Jon Watts', 2021, 'Akció', 'Peter Parker szembesül a következményekkel, miután a nyilvánosság előtt kiderül, hogy ő a Pókember. Miközben a multiverzum határain próbál rendet tenni, régi és új ellenségekkel találkozik.', '2024-11-19 10:15:08', '2024-11-19 10:15:08', NULL, 'Képregény', 'Sci-Fi'),
(17, 'Dune', 'Denis Villeneuve', 2021, 'Sci-Fi', 'A nagy dűne (Arrakis) bolygó erőforrásai miatt vívott küzdelem közepette Paul Atreides, egy fiatal herceg szembesül a saját sorsával, miközben próbál megvédeni mindent, amit szeret.', '2024-11-19 10:16:48', '2024-11-19 10:16:48', NULL, 'Kaland', 'Dráma'),
(18, 'Soul', 'Pete Docter', 2020, 'Animáció', 'Joe Gardner, egy jazzzenész, aki szívét-lelkét a zenének szenteli, egy baleset következtében a túlvilágon találja magát. Itt tanulja meg, hogy mi az igazi értelme az életnek, miközben egy másik léleknek segít megtalálni saját célját.', '2024-11-19 10:21:54', '2024-11-19 10:21:54', NULL, 'Dráma', 'Családi'),
(19, 'Tenet', 'Christopher Nolan', 2020, 'Akció', 'Egy titkos ügynök, aki egy különleges technológiát birtokol, a múlt és a jövő határán egy szoros és összetett kémkedési küldetésben vesz részt, hogy megakadályozzon egy világméretű katasztrófát.', '2024-11-19 10:26:45', '2024-11-19 10:26:45', NULL, 'Sci-Fi', 'Thriller'),
(20, 'Joker', 'Todd Phillips', 2019, 'Dráma', 'A történet bemutatja Arthur Fleck, egy mentálisan beteg férfi útját, aki végül a Gotham City legnagyobb szupergonoszává, Jokerré válik.', '2024-11-19 10:29:39', '2024-11-19 10:29:39', NULL, 'Krimi', 'Thriller'),
(21, 'Avengers: Endgame', 'Anthony Russo, Joe Russo', 2019, 'Akció', 'Az Avengers csapatának maradék tagjai szembeszállnak Thanoszal, hogy visszaállítsák az univerzum rendjét, miután a hősök elveszítették az előző csatát.', '2024-11-19 10:30:43', '2024-11-19 10:30:43', NULL, 'Sci-Fi', 'Képregény'),
(22, 'Black Panther', 'Ryan Coogler', 2018, 'Akció', 'T\'Challa, Wakanda királya megpróbálja megvédeni hazáját egy száműzött harcostól, miközben új vezetőként áll a nemzet élére.', '2024-11-19 11:05:53', '2024-11-19 11:05:53', NULL, 'Képregény', 'Dráma'),
(23, 'Avengers: Infinity War', 'Anthony Russo, Joe Russo', 2018, 'Akció', 'Az Avengers csapata és más hősök próbálnak szembeszállni Thanoszal, aki egy hatalmas erőt keres, hogy végezzen az univerzum felével.', '2024-11-19 11:10:42', '2024-11-19 11:10:42', NULL, 'Sci-Fi', 'Képregény'),
(24, 'Wonder Woman', 'Patty Jenkins', 2017, 'Akció', 'Diana, a híres amazon harcos, felfedezi szupererőit, miközben a világ első világháborújában küzd a gonosz erőkkel.', '2024-11-19 11:19:09', '2024-11-19 11:19:09', NULL, 'Képregény', 'Fantasy'),
(25, 'Dunkirk ', 'Christopher Nolan', 2017, 'Háborús', 'A Dunkerque-i evakuálás története, amely során több ezer brit és francia katona próbálja túlélni a náci megszállás közepette.', '2024-11-19 11:22:25', '2024-11-19 11:22:25', NULL, 'Dráma', 'Történelmi'),
(26, 'La La Land', 'Damien Chazelle', 2016, 'Musical', 'Egy fiatal zenész és egy ambiciózus színésznő találkozik Los Angelesben, miközben próbálnak érvényesülni a karrierjükben.', '2024-11-20 08:11:43', '2024-11-20 08:11:43', NULL, 'Dráma', 'Romantikus'),
(27, 'Deadpool', 'Tim Miller', 2016, 'Akció', 'Wade Wilson, egy volt zsoldos, aki kísérlet következtében szupergyors regenerációs képességekre tesz szert, hogy bosszút álljon egykori gyilkosain.', '2024-11-20 08:13:41', '2024-11-20 08:13:41', NULL, 'Képregény', 'Komédia'),
(28, 'Mad Max: Fury Road', 'George Miller', 2015, 'Akció', 'A világvégi apokalipszis közepette Max és Furiosa egy elnyomó vezető hatalmát próbálják megdönteni, miközben a túlélésért harcolnak.', '2024-11-20 08:16:16', '2024-11-20 08:16:16', NULL, 'Sci-Fi', NULL),
(29, 'Star Wars: The Force Awakens', 'J.J. Abrams', 2015, 'Sci-Fi', 'Az új trilógia első része, melyben Rey, egy fiatal nő és Finn, egy volt rohamosztagos felkelést indítanak az Első Rend ellen, miközben Luke Skywalker és a galaktikus háború utóhatásai visszatérnek.', '2024-11-20 08:24:13', '2024-11-20 08:24:13', NULL, 'Akció', 'Kaland'),
(30, 'Interstellar', 'Christopher Nolan', 2014, 'Sci-Fi', 'Egy csoportra bízzák a feladatot, hogy felfedezzenek egy új lakható bolygót, miközben a Földön egy globális éhínség fenyeget.', '2024-11-26 09:01:41', '2024-11-26 09:01:41', NULL, 'Dráma', 'Kaland'),
(31, 'Guardians of the Galaxy', 'James Gunn', 2014, 'Akció', 'Egy csapat galaktikus zűrös összefog, hogy megakadályozzák egy intergalaktikus háborút.', '2024-11-26 09:17:51', '2024-11-26 09:17:51', NULL, 'Sci-Fi', 'Képregény'),
(32, 'Iron Man 3', 'Shane Black', 2013, 'Ackió', 'Tony Stark szembesül a \"Mandarin\" nevű terrorista fenyegetéssel, miközben próbálja helyreállítani az életét a \"New York-i csata\" után.', '2024-11-26 09:23:32', '2024-11-26 09:23:32', NULL, 'Sci-Fi', 'Képregény'),
(33, 'Frozen', 'Jennifer Lee, Chris Buck', 2013, 'Animáció', 'Két testvér, Elsa és Anna, egy varázslatos világban találják magukat, miközben Elsa ereje elrontja az életüket, és el kell menekülniük a királyságból.', '2024-11-26 09:27:29', '2024-11-26 09:27:29', NULL, 'Kaland', 'Családi'),
(34, 'Skyfall', 'Sam Mendes', 2012, 'Ackió', 'James Bond visszatér, hogy szembenézzen egy múltbéli ellenséggel, aki titkokat próbál kideríteni a MI6-ról.', '2024-11-26 09:29:40', '2024-11-26 09:29:40', NULL, 'Thriller', 'Kém'),
(35, 'The Avengers', 'Joss Whedon', 2012, 'Akció', 'A Marvel hősei, mint Thor, Iron Man, Hulk, Captain America és mások, összefognak, hogy megvédjék a Földet Loki világuralmi tervétől.', '2024-11-26 09:31:26', '2024-11-26 09:31:26', NULL, 'Képregény', 'Sci-Fi'),
(36, 'Harry Potter and the Deathly Hallows: Part 1', 'David Yates', 2010, 'Fantasy', 'Harry, Ron és Hermione elhagyják Hogwartot, hogy megkeressék és elpusztítsák Voldemort horcruxait, hogy megakadályozzák a sötét varázsló uralkodását.', '2024-11-26 09:34:34', '2024-11-26 09:34:34', NULL, 'Kaland', NULL),
(37, 'Drive', 'Nicolas Winding Refn', 2011, 'Akció', 'Egy névtelen, csendes sofőr élete teljesen megváltozik, amikor segítséget nyújt egy nőnek, akit bűnözők fenyegetnek.', '2024-11-26 09:36:37', '2024-11-26 09:36:37', NULL, 'Dráma', 'Thriller'),
(38, 'The Social Network', 'David Fincher', 2010, 'Dráma', 'Mark Zuckerberg és a Facebook története, bemutatva, hogyan vált egy egyszerű egyetemi projekt világméretű vállalattá.', '2024-11-26 09:57:11', '2024-11-26 09:57:11', NULL, 'Történelmi', NULL),
(39, 'Inception', 'Christopher Nolan', 2010, 'Sci-Fi', 'Egy tolvaj, aki az emberek álmaiba hatol, hogy ellopja a titkaikat, egy végső küldetést vállal, hogy helyreállítsa az életét.', '2024-11-26 09:59:32', '2024-11-26 09:59:32', NULL, 'Thriller', 'Akció'),
(40, 'The Hangover', 'Todd Phillips', 2009, 'Komédia', 'Három férfi megpróbálja összeszedni magát és emlékezni, mi történt egy Las Vegas-i legénybúcsú után, miközben egyre abszurdabb helyzetekbe keverednek.', '2024-11-26 10:05:24', '2024-11-26 10:05:24', NULL, NULL, NULL),
(41, 'Avatar', 'James Cameron', 2009, 'Sci-Fi', 'A távoli Pandora bolygón egy félig ember, félig Na\'vi férfi kémkedés közben beleszeret a helyi népbe, miközben a bolygó erőforrásaiért vívott háború elkerülhetetlenné válik.', '2024-11-26 10:07:48', '2024-11-26 10:08:36', NULL, 'Kaland', 'Dráma'),
(42, 'Iron Man', 'Jon Favreau', 2008, 'Akció', 'Tony Stark, egy gazdag fegyvergyáros, egy tragikus esemény után páncélba öltözik és Iron Manként harcol a világ védelmében.', '2024-11-26 10:12:27', '2024-11-26 10:12:27', NULL, 'Sci-Fi', 'Képregény'),
(43, 'The Dark Knight', 'Christopher Nolan', 2008, 'Akció', 'Batman szembeszáll a Joker nevű anarchista bűnözővel, aki a Gotham City-t igyekszik anarchiába taszítani.', '2024-11-26 10:16:04', '2024-11-26 10:16:04', NULL, 'Krimi', 'Dráma'),
(44, 'Transformers', 'Michael Bay', 2007, 'Akció', 'Az emberiségnek szembe kell néznie egy idegen robotfajjal, a Transformersszel, akik képesek átalakulni járművekké és fegyverekké.', '2024-11-26 10:21:16', '2024-11-26 10:21:16', NULL, 'Sci-Fi', 'Kaland'),
(45, 'No Country for Old Men', 'Ethan Coen, Joel Coen', 2007, 'Krimi', 'Egy mexikói drogszállítmány elcsenése után egy kegyetlen gyilkos üldözi a pénz után menekülő férfit, miközben egy öreg seriff próbál rendet tenni.', '2024-11-26 10:28:10', '2024-11-26 10:28:10', NULL, 'Dráma', 'Thriller'),
(46, 'The Prestige', 'Christopher Nolan', 2006, 'Dráma', 'Két 19. századi bűvész szembesül a konkurenciájával, miközben a trükkjeik egyre veszélyesebbé és titokzatosabbá válnak.', '2024-11-26 10:29:54', '2024-12-04 07:24:43', NULL, 'Thriller', 'Misztikus'),
(49, 'The Departed', 'Martin Scorsese', 2006, 'Bűnügyi', 'A bostoni rendőrség és a bűnözői világ közötti háború kulcsfontosságú szereplője egy beépített rendőr és egy beépített gengszter, akik egymást próbálják kémkedéssel leleplezni.', '2024-12-04 07:28:48', '2024-12-04 07:28:48', NULL, 'Dráma', 'Thriller'),
(50, 'War of the Worlds', 'Steven Spielberg', 2005, 'Sci-Fi', 'Egy rendkívüli idegen invázió sújtja a Földet, miközben egy család megpróbál túlélni a világvégi káosz közepette.', '2024-12-04 09:18:47', '2024-12-04 09:18:47', NULL, 'Akció', 'Dráma'),
(51, 'Batman Begins', 'Christopher Nolan', 2005, 'Akció', 'Bruce Wayne visszatér Gotham Citybe, hogy megtalálja a módját annak, hogyan lehet legyőzni a bűnözést, és új életet adni a városnak mint Batman.', '2024-12-04 09:20:13', '2024-12-04 09:20:13', NULL, 'Dráma', 'Képregény');

